<!DOCTYPE html PUBLIC "-//W3C//DTD XHTML 1.0 Transitional//EN" "http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd">

<html xmlns="http://www.w3.org/1999/xhtml">
<head>
<title></title>
<script type="text/javascript">

	window.onload = function() {
		if (!(window.parent.AJILE && window.parent.AJILE)) return;
		try{
			var p = window.parent, pHis = p.AJILE.history.SessionHistory;
			document.title = p.document.title;
			var srch = document.location.search.toString().substring(1).replace(/.*?\&p=/i, '');
			if (srch && srch != pHis.check(pHis.size-1).url)
				{ if (p.AJILE.par.name && pHis.size == 1) p.AJILE.par.removeParSpecific(); pHis.pop(); }
		}
		catch(e) {}
	}
	
</script>
</head>

<body>

</body>
</html>
